import { DataPathRouterItemsType } from "../../types/types"
import LogInPage from "../../pages/LogInPage"
import SignInPage from "../../pages/SignInPage"

export const DataPublick: DataPathRouterItemsType = [
    {
        path: '/',
        element: <LogInPage />
    }
]

export const DataPrivate: DataPathRouterItemsType = [
    {
        path: '/',
        element: <SignInPage />
    },
    {
        path: '/MyPosts',
        element: undefined
    },
    {
        path: '/WorldPosts',
        element: undefined
    },
    {
        path: '/Profile',
        element: undefined,
    },
    {
        path: '/AboutThisProject',
        element: undefined,
    },
    {
        path: '/AboutMe',
        element: undefined,
    }
]
